      <AtendimentoSession6 modo={modo} />
      <AtendimentoSession7 modo={modo} />
      <style jsx>{`
        .contentAtendimento {
          /* margin:30px;
          max-width:1330px; */
          /*margin: 70px 300px 40px 300px;*/
          /*margin-left: 30px;
            margin-right: 30px;*/
                margin: 0 auto;
                margin-top: 80px;
                max-width:1330px;
                width: 100%;  
        }
      `}</style>
    </div>
  );
};

export default contentAtendimento;
